<script type="text/javascript" src="https://cdn.jsdelivr.net/npm/lozad/dist/lozad.min.js"></script>
<script src="https://cdn.jsdelivr.net/npm/select2@4.1.0-rc.0/dist/js/select2.min.js"></script>

<script>
	const observer = lozad(); // lazy loads elements with default selector as '.lozad'
	observer.observe();



	// zoom
	const scheme = document.querySelector('#svgMap');
	const zoomInButton = document.querySelector('#zooPlus');
	const zoomOutButton = document.querySelector('#zooMinus');
	const panzoom = Panzoom(scheme, {
		minScale: 1,
		maxScale: 8,
	});
	zoomInButton.addEventListener('click', panzoom.zoomIn);
	zoomOutButton.addEventListener('click', panzoom.zoomOut);
	// активируем карту
	$('#zooMinus, #zooPlus, .scheme-wrap').on('click', () => {
		$('.scheme-wrap').addClass('active');
	});
	// клик вне карты отключаем ее
	$('body').on('touchstart', (e) => {
		if ($(e.target).closest('.svg-wrap path, .region-popup, .zoom-svg').length == 0) {
			$('.scheme-wrap').removeClass('active');
			panzoom.reset('reset');
		}
	});



	// выбор белков
	$('.squirrels-btn').click(function () {
		$('.nutrients-nav .button').removeClass('active');
		$(this).addClass('active');
		$('.power-map').attr('class', 'power-map squirrels-select');
	}); // для всех сбрасываем active
	// для всех сбрасываем active

	// выбор жиров
	$('.fats-btn').click(function () {
		$('.nutrients-nav .button').removeClass('active');
		$(this).addClass('active');
		$('.power-map').attr('class', 'power-map fats-select');
	});
	// выбор углеводов
	$('.carbohydrates-btn').click(function () {
		$('.nutrients-nav .button').removeClass('active');
		$(this).addClass('active');
		$('.power-map').attr('class', 'power-map carbohydrates-select');
	});
	// выбор калорийности
	$('.calory-btn').click(function () {
		$('.nutrients-nav .button').removeClass('active');
		$(this).addClass('active');
		$('.power-map').attr('class', 'power-map calory-select');
	});

	// закрытие region-popup по крестику
	$('.region-popup .close').click(() => {
		$('.region-popup').removeClass('active');
		$('.svg-wrap path').attr('class', '');
	});

	function coordinatesPoint() {
		const path = $('.svg-wrap path.active');
		const offsetLeft = path.offset().left - path.parent().offset().left; // получаю левую позицию path
		const offsetTop = path.offset().top - path.parent().offset().top; // получаю верхнюю позицию path
		const offsetWidth = path[0].getBoundingClientRect().width / 2; // получаю ширину и делим на 2 path
		const offsetHeight = path[0].getBoundingClientRect().height / 2; // получаю высоту и делим на 2 path

		// добавляю полученные координаты region-popup
		const schemeItem = $('.region-popup.active');
		$(schemeItem).css('top', `${offsetTop + offsetHeight}px`);
		$(schemeItem).css('left', `${offsetLeft + offsetWidth}px`);
	}

	<?if ($currentRegion){?>
	$(document).ready(function () {
		$('#btnRegion').click();
		$('.svg-wrap path[data-id=' + <?=$currentRegion?> + ']').click();
	})
	<?};?>

</script>

